import React, { useState } from "react";
import styles from "./Library.module.css";
import { iconMap } from "../../utils/iconMap";

const Library = () => {
  const [activeTab, setActiveTab] = useState("All Content");

  const quizzes = [
    {
      id: 1,
      title: "Colours: What colour is it?",
      author: "John Doe",
      questions: 20,
      grade: "2nd Grade",
      subject: "Art",
      likes: 150,
      image: "https://www.zoo-berlin.de/fileadmin/_processed_/0/4/csm_artenschutzweltweit_galerie2_panda_c322790646.jpg", // Replace with actual image URL
    },
    {
      id: 2,
      title: "Science Challenge",
      author: "Jane Smith",
      questions: 15,
      grade: "Grade 6",
      subject: "Science",
      likes: 200,
      image: "https://www.zoo-berlin.de/fileadmin/_processed_/0/4/csm_artenschutzweltweit_galerie2_panda_c322790646.jpg", // Replace with actual image URL
    },
    {
      id: 3,
      title: "History Trivia",
      author: "Alice Johnson",
      questions: 25,
      grade: "Grade 7",
      subject: "History",
      likes: 120,
      image: "https://www.zoo-berlin.de/fileadmin/_processed_/0/4/csm_artenschutzweltweit_galerie2_panda_c322790646.jpg", // Replace with actual image URL
    },
  ];

  const handleTabClick = (tab: string) => {
    setActiveTab(tab);
  };

  return (
    <div className={styles.libraryPage}>
      {/* Navigation Bar */}
      <nav className={styles.navBar}>
        {["All Content", "Previously Used", "Created By Me", "Collected"].map((tab) => (
          <button
            key={tab}
            className={`${styles.navButton} ${activeTab === tab ? styles.active : ""}`}
            onClick={() => handleTabClick(tab)}
          >
            {tab}
          </button>
        ))}
      </nav>

      {/* Quiz List */}
      <div className={styles.quizGrid}>
        {quizzes.map((quiz) => (
          <div key={quiz.id} className={styles.quizCard}>
            <img src={quiz.image} alt={quiz.title} className={styles.quizImage} />
            <div className={styles.quizContent}>
              <div className={styles.quizText}>
                <h2 className={styles.quizTitle}>{quiz.title}</h2>
                <p className={styles.quizInfo}>
                  By {quiz.author}
                </p>
                <p className={styles.quizInfo}>
                  {quiz.questions} Questions • {quiz.grade} • {quiz.subject}
                </p>
                <p className={styles.quizInfo}>
                  <iconMap.star className={styles.collectedByIcon} />
                  {quiz.likes} liked
                </p>
              </div>
              <div className={styles.quizActions}>
                <button className={styles.detailButton}>Details</button>
                <button className={styles.assignButton}>Assign</button>
            </div>
            </div>
          </div>
        ))}
      </div>
    </div>
  );
};

export default Library;
